const t=JSON.parse('{"key":"v-18ed4466","path":"/posts/thinking/2023/2023-5-25-money-with-life.html","title":"金钱是有生命力的","lang":"zh-CN","frontmatter":{"icon":"edit","date":"2023-05-25T00:00:00.000Z","isOriginal":true,"category":["thinking"],"tag":["thinking","write"]},"headers":[{"level":2,"title":"金钱是有生命力的","slug":"金钱是有生命力的-1","link":"#金钱是有生命力的-1","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":1.83,"words":548},"filePathRelative":"posts/thinking/2023/2023-5-25-money-with-life.md","localizedDate":"2023年5月25日","excerpt":"<h1> 金钱是有生命力的</h1>\\n<div class=\\"hint-container tip\\">\\n<p class=\\"hint-container-title\\">提示</p>\\n<p>通常，我们对于一些观点都有一些属于自己的看法，而大多数人类似的看法就组成了大众的看法，比如说金钱是有生命力的观点。</p>\\n</div>\\n<p>首先我们需要对生命力这个形容词进行一个定义，我首先来说说我的定义，生命是有诞生，成长和衰老和死亡过程的，那么与之对应生命力这个形容词也是有对应的诞生、成长和消亡属性的。</p>\\n<p>::: card\\n于是金钱有生命力的含义是，金钱也是有诞生、成长和消亡属性的。\\n:::</p>"}');export{t as data};
